import '../App.css'
import MenuDesplegable from '../Layouts/MenuDesplegable';
import { NavBar } from '../Layouts/NavBar';

export function Home() {
    return ( 
        <div>
            <div className="dropdown_home">
                <div className='dropdown_navbar'><NavBar/></div>
                <div className='dropdown'><MenuDesplegable/></div>
    border-bottom: solid 4px #EBE812;
                <hr color='' className='lineal'/>
            </div>
        </div>
    );
}
